[{"location":"api/#JacobiElliptic-API","page":"JacobiElliptic API","title":"JacobiElliptic API","text":"","category":"section"},{"location":"api/#Index","page":"JacobiElliptic API","title":"Index","text":"","category":"section"},{"location":"api/","page":"JacobiElliptic API","title":"JacobiElliptic API","text":"api.md","category":"page"},{"location":"api/#Elliptic-Integrals","page":"JacobiElliptic API","title":"Elliptic Integrals","text":"","category":"section"},{"location":"api/","page":"JacobiElliptic API","title":"JacobiElliptic API","text":"JacobiElliptic.K\nJacobiElliptic.E\nJacobiElliptic.F\nJacobiElliptic.Pi\nJacobiElliptic.J","category":"page"},{"location":"api/#JacobiElliptic.K","page":"JacobiElliptic API","title":"JacobiElliptic.K","text":"K(m) -> Any\n\n\nK(m) = int_0^pi2fracdthetasqrt1-k^2sin(theta)^2\n\nReturns the complete elliptic integral of the first kind.\n\nArguments\n\nm : Elliptic modulus\n\n\n\n\n\n","category":"function"},{"location":"api/#JacobiElliptic.E","page":"JacobiElliptic API","title":"JacobiElliptic.E","text":"E(m) -> Any\n\n\nE(m) = int_0^pi2sqrt1-k^2sin(theta)^2dtheta\n\nReturns the complete elliptic integral of the second kind.\n\nArguments\n\nm : Elliptic modulus\n\n\n\n\n\nE(φ, m) -> Any\n\n\nE(varphi m) = int_0^varphidtheta sqrt1-msin(theta)^2\n\nReturns the incomplete elliptic integral of the second kind.\n\nArguments\n\nφ : Amplitude\nm : Elliptic modulus\n\n\n\n\n\n","category":"function"},{"location":"api/#JacobiElliptic.F","page":"JacobiElliptic API","title":"JacobiElliptic.F","text":"F(φ, m) -> Any\n\n\nF(varphi  m) = int_0^varphifracdthetasqrt1-msin(theta)^2\n\nReturns the incomplete elliptic integral of the first kind.\n\nArguments\n\nφ : Amplitude\nm : Elliptic modulus\n\n\n\n\n\n","category":"function"},{"location":"api/#JacobiElliptic.Pi","page":"JacobiElliptic API","title":"JacobiElliptic.Pi","text":"Pi(n, m) -> Any\n\n\nPi(nm)=int_0^1 frac11-nt^2fracdtsqrtleft(1-mt^2right)left(1-t^2right)\n\nReturns the complete elliptic integral of the third kind.\n\nArguments\n\nn : Characteristic\nm : Elliptic modulus\n\n\n\n\n\nPi(n, φ, m) -> Any\n\n\nPi (nvarphi m)=int _0^sin varphi frac 11-nt^2frac dtsqrt left(1-mt^2right)left(1-t^2right)\n\nReturns the incomplete elliptic integral of the third kind.\n\nArguments\n\nn : Characteristic\nφ : Amplitude\nm : Elliptic modulus\n\n\n\n\n\n","category":"function"},{"location":"api/#JacobiElliptic.J","page":"JacobiElliptic API","title":"JacobiElliptic.J","text":"J(n, φ, m) -> Any\n\n\nJ (nvarphi m)=fracPi(nvarphi m) - F(varphim)n\n\nReturns the associate incomplete elliptic integral of the third kind.\n\nArguments\n\nn : Characteristic\nφ : Amplitude\nm : Elliptic modulus\n\n\n\n\n\nJ(n, m) -> Any\n\n\nJ(nvarphi m)=fracPi(npi2 m) - K(m)n\n\nReturns the associate complete elliptic integral of the third kind.\n\nArguments\n\nn : Characteristic\nm : Elliptic modulus\n\n\n\n\n\n","category":"function"},{"location":"api/#Jacobi-Elliptic-Functions","page":"JacobiElliptic API","title":"Jacobi Elliptic Functions","text":"","category":"section"},{"location":"api/","page":"JacobiElliptic API","title":"JacobiElliptic API","text":"JacobiElliptic.sn\nJacobiElliptic.cn\nJacobiElliptic.dn\nJacobiElliptic.asn\nJacobiElliptic.acn","category":"page"},{"location":"api/#JacobiElliptic.sn","page":"JacobiElliptic API","title":"JacobiElliptic.sn","text":"sn(u, m) -> Any\n\n\ntextsn(um)=sintextam(um), where textam(um)=F^-1(um)  is the Jacobi amplitude.\n\nReturns the Jacobi Elliptic sn.\n\nArguments\n\nu : Amplitude\nm : Elliptic modulus\n\n\n\n\n\n","category":"function"},{"location":"api/#JacobiElliptic.cn","page":"JacobiElliptic API","title":"JacobiElliptic.cn","text":"cn(u, m) -> Any\n\n\ntextcn(um)=costextam(um), where textam(um)=F^-1(um)  is the Jacobi amplitude.\n\nReturns the Jacobi Elliptic cn.\n\nArguments\n\nu : Amplitude\nm : Elliptic modulus\n\n\n\n\n\n","category":"function"},{"location":"api/#JacobiElliptic.dn","page":"JacobiElliptic API","title":"JacobiElliptic.dn","text":"dn(u, m) -> Any\n\n\ntextdn(um)=fracdd utextam(um), where textam(um)=F^-1(um)  is the Jacobi amplitude.\n\nReturns the Jacobi Elliptic dn.\n\nArguments\n\nu : Amplitude\nm : Elliptic modulus\n\n\n\n\n\n","category":"function"},{"location":"api/#JacobiElliptic.asn","page":"JacobiElliptic API","title":"JacobiElliptic.asn","text":"asn(s, m) -> Any\n\n\ntextasn(um)=textsn^-1(um).\n\nReturns the inverse Jacobi Elliptic sn.\n\nArguments\n\nu : Amplitude\nm : Elliptic modulus\n\n\n\n\n\n","category":"function"},{"location":"api/#JacobiElliptic.acn","page":"JacobiElliptic API","title":"JacobiElliptic.acn","text":"acn(c, m) -> Any\n\n\ntextacn(um)=textcn^-1(um).\n\nReturns the inverse Jacobi Elliptic cn.\n\nArguments\n\nu : Amplitude\nm : Elliptic modulus\n\n\n\n\n\n","category":"function"},{"location":"","page":"Home","title":"Home","text":"CurrentModule = JacobiElliptic","category":"page"},{"location":"#JacobiElliptic","page":"Home","title":"JacobiElliptic","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"JacobiElliptic is an implementation of Toshio Fukushima's algorithms for calculating Elliptic Integrals and Jacobi Elliptic Functions. ","category":"page"},{"location":"#Features","page":"Home","title":"Features","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Type stable and preserving\nMetal.jl and CUDA.jl compatible","category":"page"},{"location":"#Contents","page":"Home","title":"Contents","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Pages = [\n    \"api.md\"\n]","category":"page"}]
